import React from 'react';
import { Auth0Provider } from '@auth0/auth0-react';
import { BrowserRouter as Router } from 'react-router-dom';
import { Route, Routes } from 'react-router-dom';
import Header from './components/Header';  // Asegúrate de tener este componente
import LoginPage from './components/LoginPage';  // Asegúrate de tener este componente

const domain = 'your-auth0-domain';
const clientId = 'your-auth0-client-id';

function App() {
  return (
    <Auth0Provider
      domain={domain}
      clientId={clientId}
      authorizationParams={{ redirect_uri: window.location.origin }}
    >
      <Router>
        <Header /> {/* Componente Header con botones de Login/Logout */}
        <Routes>
          <Route path="/login" element={<LoginPage />} />  {/* Ruta de login */}
          {/* Aquí agregas otras rutas de tu aplicación */}
          <Route path="/dashboard" element={<div>Dashboard</div>} />
          <Route path="/" element={<div>Home Page</div>} />
        </Routes>
      </Router>
    </Auth0Provider>
  );
}

export default App;
